function out = JR_slow
out{1} = @init;
out{2} = @fun_eval;
out{3} = @jacobian;
out{4} = @jacobianp;
out{5} = @hessians;
out{6} = @hessiansp;
out{7} = @der3;
out{8} = [];
out{9} = [];

% --------------------------------------------------------------------------
function dydt = fun_eval(t,kmrgd,par_A,par_a,par_Bs,par_bs,par_Bf,par_bf,par_e0,par_r,par_v0,par_theta,par_CC,par_II)
C1=par_CC;;
C2=0.8*par_CC;;
C3=0.25*par_CC;;
C4=0.25*par_CC;;
S4=2*par_e0/(1+exp(par_r*(par_v0-(kmrgd(3)-par_theta*kmrgd(5)-(1-par_theta)*kmrgd(7)))));;
S5=2*par_e0/(1+exp(par_r*(par_v0-(C1*kmrgd(1)))));;
S6=2*par_e0/(1+exp(par_r*(par_v0-(C3*kmrgd(1)))));;
S7=S6;;
dydt=[kmrgd(2);;
par_A*par_a*S4-2*par_a*kmrgd(2)-par_a*par_a*kmrgd(1);;
kmrgd(4);;
par_A*par_a*(par_II+C2*S5)-2*par_a*kmrgd(4)-par_a*par_a*kmrgd(3);;
kmrgd(6);;
par_Bf*par_bf*C4*S6-2*par_bf*kmrgd(6)-par_bf*par_bf*kmrgd(5);;
kmrgd(8);;
par_Bs*par_bs*C4*S7-2*par_bs*kmrgd(8)-par_bs*par_bs*kmrgd(7);;];

% --------------------------------------------------------------------------
function [tspan,y0,options] = init
handles = feval(JR_slow);
y0=[0,0,0,0,0,0,0,0];
options = odeset('Jacobian',handles(3),'JacobianP',handles(4),'Hessians',handles(5),'HessiansP',handles(6));
tspan = [0 10];

